it-->เราต้อนรับลูกค้าในวินาทีแรกด้วย Champagne ก่อนที่จะเชิญลูกค้าลงไปสู่โต๊ะที่จัดเตรียมไว้ในลำธารที่น้ำใสราวกับกระจก สัมผัสกับประสบการณ์แห่งความสุขใกล้ชิดธรรมชาติกับช่วงเวลา High Tea พร้อมกับฟังเสียงของขุนเขาและสายน้ำ<!--split-->ช่วงเวลา Dinner ที่เราเตรียม Wine Tasting ที่คัดสรรโดย Sommelier อันดับต้นของประเทศ ที่เลือก Wine หายากจากประเทศฝรั่งเศสและอิตาลี มาให้ลิ้มลองรสชาติกัน ทั้ง Wine จากหมู่บ้านเล็กๆในฝรั่งเศสที่ผลิตในจำนวนจำกัด Wine จากสายพันธุ์องุ่นที่กำลังจะสูญพันธุ์ และ Wine ที่มีกระบวนการผลิตแตกต่างที่ให้รสชาติเป็นเอกลักษณ์ไม่เหมือนใคร เพื่อเปิดประสบการณ์การดื่ม Wine ที่ไม่สามารถหาจากที่ใดได้ง่ายๆ'},{listname:"",description:"ช่วงเวลาTest Drive ที่ทุกคนรอคอย โดยการดูแลอย่างใกล้ชิดจากทีม Certified Instructor ของ BMW ลูกค้าได้ทดลองขับ BMW X7, BMW 7 Series, BMW XM บน Scenic Drive เส้นทางคดเคี้ยวเลียบขนาบด้วยขุนเขาท่ามกลางทัศนียภาพที่สวยงาม และ Gymkhana สนาม Test Drive สุดโหดที่ลูกค้าจะได้รับความสนุกเร้าใจ<!split>เสริมด้วย Gimmic เล็กๆ เราพาทุกคนไปสัมผัสกับชุมชนท้องถิ่น ใส่บาตรพระริมน้ำยามเช้า ชมฝูงสุนัขต้อนแกะ และรับประทาน Chef’s Table & Wine Pairing ริมลำธาร กับอาหารสไตล์ Rustic<!--split--> เราจัดทำส่วนประกอบต่างๆที่เป็นEvent Identity ของ BMW ในงานเช่น Welcome Card, Tent Card, J Flag, ป้ายชื่อ Dinner<!--split-->เป็นอีกหนึ่งรูปแบบ Lifestyle Event ที่เรานำกิจกรรม Outdoor Adventure มาผสมผสานกับความหรูหรา มีระดับอย่างลงตัว เป็นการสร้างประสบการณ์ใหม่แก่ลูกค้าที่ทั้งน่าประทับใจและไม่รู้ลืม"}];return N.useEffect(()=>{window.scrollTo(0,0)},[]),u.jsxs("div",{className:"max-w-[1920px] mx-auto",children:[u.jsx(Ce,{bannerDetail:e}),u.jsx(ke,{imageList:t}),u.jsx(Ne,{projectDetailDescription:n,descriptionList:r})]})}function gy(){const e={projectName:"Bangsean",projectType:"Health Festival",clientName:"Saensuk Municipality",serviceType:"( Events & Lifestyle Activities )",projectIntro:"Brand visual identity for the Power Development Fund of Thailand and partners, under the Integrated Communication project, focusing on the thematic ‘Clean Energy for Life’ with creating mode